/*global $*/

function initializeHomePage() {
    var $processes = $('#processes-listing');
    var $roles = $('#roles-listing');
    var $taskBox = $('.index-small-boxes-home-page .bg-yellow');
    var $qtBox = $('.index-small-boxes-home-page .bg-gray');
    
    $('.index-processes-box').click(function() {
        $processes.slideToggle('fast', function() {
            if (!$roles.is(":hidden")) { $roles.toggle(); }
            $processes.goTo();
        });
    });
    
    $('.index-roles-box').click(function() {
        $roles.slideToggle('fast', function() {
            if (!$processes.is(":hidden")) { $processes.toggle(); }
            $roles.goTo();
        });
    });
    
    $taskBox.click(function() {
        window.location.href = '/tasks'
    });
    $qtBox.click(function() {
        window.location.href = '/quality_tips'
    });
}
